/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

const rowDimension = css`
  display: flex;
  flex-flow: row;
  background-color: #f9f9f9;
  padding: 12px 14px;
  width: 100%;
`;
const TopUserRow = () => {};
const UserRow = () => {
  return (
    <div css={rowDimension}>
      <div>1</div>
      <div></div>
      <div>Jason</div>
      <div>99</div>
    </div>
  );
};

export { UserRow, TopUserRow };
